Pyproject.nix makes no attempt at parsing dynamic fields as it does not have the required knowledge to infer these. When using the withPackages renderer most fields that may be dynamic are not even relevant and won't cause issues. At other times, like when using the buildPythonPackage renderer problems occur as there is no way for the renderer to create the version attribute. let project = pyproject.project.loadPyproject { pyproject = lib.importTOML ./pyproject.toml; }; python = pkgs.python3; attrs = pyproject.renderers.buildPythonPackage { inherit python project; };
in python.pkgs.buildPythonPackage attrs Will result in an error from buildPythonpackage because version is missing: error: attribute 'version' missing at /nix/store/gna8i238i3nnz6cizcayyfyfdzn28la5-nixpkgs/pkgs/development/interpreters/python/mk-python-derivation.nix:31:28: 30| 31| { name ? "${attrs.pname}-${attrs.version}" | ^ 32| In these cases you can manually add attributes to the attribute set returned by the renderer: let project = pyproject.project.loadPyproject { pyproject = lib.importTOML ./pyproject.toml; }; python = pkgs.python3; attrs = pyproject.renderers.buildPythonPackage { inherit python project; };
in python.pkgs.buildPythonPackage (attrs // { version = "1.0"; # Not dynamically inferred
}) Found an issue? Edit this page on GitHub.

